import React from "react";
import "./newsfeed.scss";
import News from "./news"
import newsfeeddata from "../../../jsonData/newsfeeddata.json";

const Newsfeed = () => {
  const courses = courseData.courses;
  const newsfeeddata = newsfeeddata.News
  return (
    <div className="newsfeed">
      <h3>Newsfeed</h3>
      {newsfeeddata.map((newsdata) => (
          <News name={newsdata.name} imgUrl={newsdata.imgUrl} message={newsdata.message} />

        ))}

    </div>
  );
};

export default Newsfeed;
